import React from "react";

const displayStyle = {
  display: "grid",
};

const wineBottleStyle = {
  width: 100,
  height: "auto",
  margin: 0,
};

const soilStyle = {
  width: 150,
  height: 300,
  backgroundColor: "tan",
};

function Winebottle() {
  return (
    <div style={displayStyle}>
      <img
        style={wineBottleStyle}
        src="./wineBottleIcon.svg"
        alt="ワインボトル"
      />
      <div style={soilStyle} />
    </div>
  );
}

export default Winebottle;
